import React from 'react';
import './home.css';
import Header from '../../components/headeer/header';
import Jumbotron from '../../components/jumbotron/jumbotron';

document.body.classList.add('home-page');

function Home() {
  return (
    <div>
      <Header />
      <Jumbotron />
    </div>
  );
}

export default Home;
